import React, { useState } from 'react';
import './App.css';
import MovieList from './Components/MovieList/MovieList';
import  moviesData   from './Contants/Data';

function App() {
  const [movies, setMovies] = useState(moviesData )
  return (
    <div className="App">
      <h1>Movie App</h1>
      <MovieList movies ={movies}/>

    </div>
  );
}

export default App;
